import Header from "../components/header";
import Texto from "../components/Texto";
import TextoDestacado from "../components/TextoDestacado";
import { Inicio, AppGeral, TextoConstrucao } from "./Home";
import styled from "styled-components";

export const Itens = styled.div`

    display: flex;
    flex-direction: row;
    justify-content: center;
    margin-top: 100px;
    margin-bottom: 100px;
    gap: 150px;
`;

export const Caixa = styled.div`
    background-color: #D9D9D9;
    display: flex;
    flex-direction: column;
    padding: 20px;
    width: 400px;
    height: auto;
    text-align: center;
`;



function ProjetoUm() {
    return (
        <AppGeral>
            <Inicio>
                <Header />
                <TextoConstrucao>Projeto X</TextoConstrucao>
            </Inicio>
            <Itens>
                <Caixa>
                    <TextoDestacado>Texto destacado</TextoDestacado>
                    <Texto>Texto normal. </Texto>
                </Caixa>
                <Caixa>
                    <TextoDestacado>Texto destacado</TextoDestacado>
                    <Texto>Texto normal</Texto>
                </Caixa>
            </Itens>
        </AppGeral>
    );
}

export default ProjetoUm;
